import React from "react";
import { FormGroup, Input, Label } from "reactstrap";
import { useForm } from "react-hook-form";
import { ShareAgreement } from "../Templates/ShareAgreement";
import SLUGS from "../../resources/slugs";
import { convertSlugUrl } from "../../resources/utils";
import { useHistory } from "react-router-dom";

export function NewAgreement() {

    const methods = useForm();
    const { push } = useHistory();
    
    
    const onSubmit = (data) => {
        console.log(JSON.stringify(data, null, 2));
        // if (data.readTerms === true) {
        //     <ShareAgreement
        //         methods={methods}
        //     />
        // } 
        push(convertSlugUrl(SLUGS.shareAgreement));
    }

        
    return (
    <div>
      <form onSubmit={methods.handleSubmit(onSubmit)}>
        <h2>Create A New Agreement</h2>
        <FormGroup>
            <label>What is the name of the Agreement</label>
            <Input
                required
                type="text"
                name="agreeName"
                innerRef={methods.register}
            />
        </FormGroup>
        <FormGroup>
            <label>What Template is the Agreement based on</label>
            <Input
                required
                type="select"
                name="tempType"
                innerRef={methods.register}
            >
            <option>Share Agreement</option>
            </Input> 
        </FormGroup>  
        <FormGroup check>
            <Label check>
              <Input type="checkbox" id="readTerms" name="readTerms" innerRef={methods.register} />{' '}
              Make sure to read our <a href="https://google.com"> Terms and services </a>
              before continuing
            </Label>
          </FormGroup> 
        <input type="submit"/>     
      </form>
    </div>
    );
    
}
